export const Login = () => {
    return (
        <form>
            <label for="email">email</label>
            <input type="email" placeholder="email" id="email" name="email"/>
            <label for="password">password</label>
            <input type="password" placeholder="passwrod" id="password" name="passwrod"/>
            <button>Login</button>
        </form>
    )
}
